#include "MainWindow.h"
#include "Game.h"
#include <random>
#include "Colors.h"
#include <chrono>

#define DUDE 0
#define POO 2
#define DUDEHIVE 1
#define POOHIVE 3

Game::Game( MainWindow& wnd )
	:
	wnd( wnd ),
	gfx( wnd )
{	
}

void Game::Go()
{
	gfx.BeginFrame();	
	UpdateModel();
	ComposeFrame();
	gfx.EndFrame();
}

void Game::ComposeFrame()
{
	// background colour
	for (auto _y = 0; _y < gfx.ScreenHeight - 1; _y++) {
		for (auto _x = 0; _x < gfx.ScreenWidth - 1; _x++) {
			gfx.PutPixel(_x, _y, 148, 65, 133);
		}
	}

	if (gameStart)
	{
		EMS.render(gfx, Entities);
		
		/*if (rightWasPressed)
		{
			drawRect(rightMouseX, rightMouseY, wnd.mouse.GetPosX(), wnd.mouse.GetPosY());
		}*/
		if (leftWasPressed)
		{
			drawRect(leftMouseX, leftMouseY, wnd.mouse.GetPosX(), wnd.mouse.GetPosY());
		}
	}
	else
	{
		drawTitle(((gfx.ScreenWidth / 2) - 75), ((gfx.ScreenHeight / 2)) - 85);
	}
}

void Game::UpdateModel()
{	
	const float dt = ft.mark();
	if (wnd.kbd.KeyIsPressed( VK_RETURN ))
	{
		gameStart = true;
	}
	if (gameStart)
	{
		if (wnd.mouse.RightIsPressed())
		{			
			if (!rightWasPressed)
			{
				rightMouseX = wnd.mouse.GetPosX();
				rightMouseY = wnd.mouse.GetPosY();				
			}
			EMS.moveSelectedDudes(Entities.staticSelectedDudesPos, Entities.movingSelectedDudesPos, rightMouseX, rightMouseY);
			rightWasPressed = true;
		}
		else
		{
			rightWasPressed = false;
		}
		
		EMS.update(Entities, dt);

		if (wnd.mouse.LeftIsPressed())
		{			
			if (!leftWasPressed)
			{
				leftMouseX = wnd.mouse.GetPosX();
				leftMouseY = wnd.mouse.GetPosY();
			}
			leftWasPressed = true;
		}
		else
		{
			if (leftWasPressed)
			{
				EMS.deselectEntities(Entities);
				EMS.selectEntities(wnd, Entities, leftMouseX, leftMouseY);
			}
			leftWasPressed = false;
		}

		if (wnd.kbd.KeyIsPressed('J'))
		{
			EMS.deselectEntities(Entities);
		}

		if (wnd.kbd.KeyIsPressed('D'))
		{
			dWasPressed = true;
		}
		else
		{
			if (dWasPressed)
			{
				EMS.addEntityToQueue(Entities, DUDE, wnd.mouse.GetPosX(), wnd.mouse.GetPosY());
			}
			dWasPressed = false;
		}

		if (wnd.kbd.KeyIsPressed('H'))
		{
			hWasPressed = true;			
		}
		else
		{
			if (hWasPressed)
			{
				EMS.addEntityToQueue(Entities, DUDEHIVE, wnd.mouse.GetPosX(), wnd.mouse.GetPosY());
			}
			hWasPressed = false;
		}
	}	
}

void Game::drawRect(int x0, int y0, int x1, int y1)
{
	drawLine(x0, y0, x1, y0);
	drawLine(x1, y0, x1, y1);
	drawLine(x1, y1, x0, y1);
	drawLine(x0, y1, x0, y0);
}

void Game::drawLine(int x0, int y0, int x1, int y1)
{
	if (x1 < x0)
	{
		std::swap(x0, x1);
	}
	if (y1 < y0)
	{
		std::swap(y0, y1);
	}
	if (x0 == x1)
	{
		for (int i = 0; i < (y1 - y0); i++)
		{
			gfx.PutPixel(x0, (y0 + i), Colors::Green);
		}
	}
	if (y0 == y1)
	{
		for (int i = 0; i < (x1 - x0); i++)
		{
			gfx.PutPixel((x0 + i), y0, Colors::Green);
		}
	}
	
}

