bool Game::squareCollision(int _x1, int _y1, int _w1,  int _x2, int _y2, int _w2)
{
	return ((_x1 <= (_x2 + (_w1 + _w2))) &&
		(_x1 >= (_x2 - (_w1 + _w2))) &&
		(_y1 <= (_y2 + (_w1 + _w2))) &&
		(_y1 >= (_y2 - (_w1 + _w2))));
}

